import React from 'react'
import Nav from '../../components/Nav'

const aboutPage = () => {
  return (
    <div>
      <Nav />
    <div className="about">
      <h1 className="aboutTitle mb-5">About The Dev Team</h1>
      <div className="aboutPage">
        <div className="member">
          <h3>Shae [Naomi Benham] </h3>
          <img className="aboutImg" src="https://ca.slack-edge.com/T0351JZQ0-U013U9V5LAZ-58229599c17f-512" />
          <h5>Designer</h5>
        </div>
        <div className="member">
          <h3>David Kim</h3>
          <img className="aboutImg" src="https://ca.slack-edge.com/T0351JZQ0-U013VNL55NW-4021bceade11-512" />
          <h5>Designer</h5>
        </div>
        <div className="member">
          <h3>Braidon Hobzek</h3>
          <img className="aboutImg" src="https://ca.slack-edge.com/T0351JZQ0-U013EJURLAG-e42e97c0d7ae-512" />
          <h5>Designer</h5>
        </div>
        <div className="member">
          <h3>Jameson Anker Aardalen</h3>
          <img className="aboutImg" src="https://ca.slack-edge.com/T0351JZQ0-U013AC1U2LD-5b3b451b0ba7-512" />
          <h5>Developer</h5>
        </div>
        <div className="member">
          <h3>Noa Kim</h3>
          <img className="aboutImg" src="https://ca.slack-edge.com/T0351JZQ0-U013K9KBAGM-99450e7d8a79-512" />
          <h5>Developer</h5>
        </div>
        <div className="member">
          <h3>Minh Nguyen</h3>
          <img className="aboutImg" src="https://ca.slack-edge.com/T0351JZQ0-U013SS45XPW-6b458202f6f4-512" />
          <h5>Developer</h5>
        </div>
      </div>
      <style jsx>{`
          .center {
            text-align: center;
          }
          .jumbo-title {
          }
          .layout-container {
            display: flex;
            justify-content: space-around;
          }
          .left-btn-container {
            display: flex;
            flex-direction: column;
            justify-content: space-around;
            height: 800px;
          }
          .jumbo {
            height: 800px;
            width: 1100px;
            display: flex;
            align-items: center;
            justify-content: center;
            border: 20px solid rgb(88, 80, 73);
            border-radius: 50px;
            background-color: black;
          }
          .right-btn-container {
            display: flex;
            flex-direction: column;
            justify-content: space-around;
            height: 800px;
          }
          .img-btn {
            border-style: none;
            padding: 0;
            margin: 0;
            border-radius: 15px;
          }
          .main-img {
            max-width: 1060px;
            max-height: 700px;
          }

          .button-set {
            margin: auto;
            margin-top: 45px;
            max-width: 600px;
          }
        `}</style>
    </div>
    </div>
  )
}

export default aboutPage
